/// seasons : [{"air_date":"2020-09-10","episode_count":19,"id":163277,"name":"Specials","overview":"","poster_path":"/cCXG81dSCPXcqYm6gTHlwtXocti.jpg","season_number":0},{"air_date":"2019-07-25","episode_count":8,"id":98085,"name":"Season 1","overview":"","poster_path":"/g3HjUeFCwKOfBxlM97lv016mnol.jpg","season_number":1},{"air_date":"2020-09-03","episode_count":8,"id":154681,"name":"Season 2","overview":"The even more intense, more insane season two finds The Boys on the run from the law, hunted by the Supes, and desperately trying to regroup and fight back against Vought. In hiding, Hughie, Mother’s Milk, Frenchie and Kimiko try to adjust to a new normal, with Butcher nowhere to be found. Meanwhile, Starlight must navigate her place in The Seven as Homelander sets his sights on taking complete control. His power is threatened with the addition of Stormfront, a social media-savvy new Supe, who has an agenda of her own. On top of that, the Supervillain threat takes center stage and makes waves as Vought seeks to capitalize on the nation’s paranoia.","poster_path":"/mY7SeH4HFFxW1hiI6cWuwCRKptN.jpg","season_number":2},{"air_date":"2022-06-02","episode_count":8,"id":215686,"name":"Season 3","overview":"It’s been a year of calm. Homelander’s subdued. Butcher works for the government, supervised by Hughie of all people. But both men itch to turn this peace and quiet into blood and bone. So when The Boys learn of a mysterious Anti-Supe weapon, it sends them crashing into the Seven, starting a war, and chasing the legend of the first Superhero: Soldier Boy.","poster_path":"/ut4PhX7OP2l2oJhrIUYWnt9pnQU.jpg","season_number":3,"networks":[{"id":1024,"logo":{"path":"/ifhbNuuVnlwYy5oXA5VIb2YR8AZ.png","aspect_ratio":3.242914979757085},"name":"Amazon","origin_country":""}]}]
